        string:
          '{"description":"<div>We host in person social events for ND gals &
          LGBTQIA+ pals, and would love for you to join our book club!<\/div><div style=\"margin-top:
          20px\"><div style=\"margin: 20px 10px;font-size: 15px;line-height: 22px;font-weight:
          400;text-align: left;\"><p>Welcome to <strong><strong>The Neurodivergent Gals
          Club<\/strong><\/strong> ! We host in person social events for ND gals &amp;
          LGBTQIA+ pals, and would love for you to join our book club! This is a fantastic
          opportunity to connect with like minded people who share a love for books.
          Let''s dive into our neurospicy reading list, share our thoughts, and make
          new friends along the way!<\/p><p><br><\/p><p>From 2025 onwards you can find
          us in the <strong><strong>co-working space<\/strong><\/strong>. You can access
          this space by heading downstairs, and back upstairs using the stair case in
          the far side of the room. Please ask at the bar if there are any issues finding
          us!<\/p><p><br><\/p><p><strong><strong>June Book Club - Fiction + Optional
          Book Swap<\/strong><\/strong><\/p><p>This month we have selected a fiction
          available in dyslexia friendly print, to coincide with Learning Disabilities
          week. <em><em>Such a Fun Age<\/em><\/em> by Kiley Reid promises to be a page-turning
          yet big-hearted story about race and privilege. Set around a young black babysitter
          and her well-intentioned employer, a surprising connection threatens to undo
          them both.<\/p><p><br><\/p><p>To celebrate one whole year of our book club
          we will also be bringing one of our favourite reads all wrapped up for a book
          swap! Wrap up your preloved book in any wrapping paper and bring along, we
          will provide stickers to write a little note to your giftee at the book club!
          Any questions, please don''t hesitate to message us on IG @the_neurodivergent_gals_club<\/p><p><br><\/p><p><strong><strong>July
          Book Club - Non Fiction<\/strong><\/strong><\/p><p>July''s read of the month
          will be <em><em>Love &amp; Autism<\/em><\/em> by Kay Kerr - five true short
          stories about neurodivergent life and love.<\/p><p><br><\/p><p>This book club
          is open to all neurodiversities at every stage of diagnosis. This includes
          those awaiting assessment, the self diagnosed or anyone curious about their
          differences that would like to find out more. We also welcome those who are
          not ND, but would like to learn how to support their neurodiverse loved ones.
          Please feel free to contact us to ask any questions or suggest monthly reads
          on Instagram @the_neurodivergent_gals_club<\/p><p><br><\/p><p><strong><strong>Looking
          forward to seeing you there!<\/strong><\/strong><\/p><\/div><\/div>"}'
