          '{"description":"<div>We invite you to unwind at our ''crafternoon''.
          This inclusive event is aimed at the queer community to come together.<\/div><div
          style=\"margin-top: 20px\"><div style=\"margin: 20px 10px;font-size: 15px;line-height:
          22px;font-weight: 400;text-align: left;\"><p>We invite you to unwind at our
          ''crafternoon''. This inclusive event is aimed at the queer community to come
          together in a cosy atmosphere, celebrating the joy of knitting, crocheting
          and other fibrecrafts.<\/p><p>This is an alcohol-free gathering that promises
          a welcoming space filled with yarns, refreshments, and a shared passion for
          all things woolly. Whether you''re a seasoned pro or just starting out, everyone
          is welcome.<\/p><p>Details:<\/p><ul><li><\/li><li>Drop in any time between
          11am and 2pm<\/li><li>All levels welcome; intro sessions for beginners<\/li><li>Bring
          your own project or use materials provided to learn<\/li><li>Relaxing atmosphere<\/li><li>Inclusive
          space for the queer community<\/li><li>Alcohol-free event<\/li><li>Limited
          free tickets available<\/li><\/ul><\/div><\/div>"}'
