          '{"description":"<div>Let your inner child free! Come and join us for
          queer mixed media workshops.<\/div><div style=\"margin-top: 20px\"><div style=\"margin:
          20px 10px;font-size: 15px;line-height: 22px;font-weight: 400;text-align: left;\"><p><strong><strong>LET
          YOUR INNER CHILD RUN FREE!!<\/strong><\/strong><\/p><p><br>All materials are
          provided, all you need is yourself and the desire to have fun with art.<\/p><p>Full
          instruction can be provided if required also.<\/p><p><br><\/p><p>4 community,
          4 expression 4 creativity, 4 All.<\/p><p><br><\/p><p>Queer Lit &amp; Social
          Refuge is an accesible building with step free entrance, access lifts and
          toilet.<\/p><p>If there are any specific requirments please contact event
          manager Alix on Alix@socialrefuge.com.<\/p><p>Join us in the latest of mixed
          media art workshops and social with the lovely @annastevens.art on Sunday
          through the year.<\/p><p><br><\/p><\/div><\/div>"}'
